import React, { useState } from "react";

const Tile = (props) => {
    const [isOccupied, setIsOccupied] = useState(false);

    const xCoord = props.coords.x;
    const yCoord = props.coords.y;

    return (
        <td>{xCoord}{yCoord}</td>
    )
}

export default Tile;
